// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ListaTrustFixed {
    struct Utang {
        uint id;
        address storeOwner;
        address customer;
        uint amount;
        string description;
        bool paid;
        uint timestamp;
    }
    
    Utang[] public utangList;
    
    // Event without string parameter (simpler)
    event NewUtangRecorded(uint indexed id, address customer, uint amount);
    event UtangPaid(uint indexed id);
    
    // Add new utang
    function addUtang(address _customer, uint _amount, string memory _description) public {
        uint newId = utangList.length;
        
        utangList.push(Utang({
            id: newId,
            storeOwner: msg.sender,
            customer: _customer,
            amount: _amount,
            description: _description,
            paid: false,
            timestamp: block.timestamp
        }));
        
        emit NewUtangRecorded(newId, _customer, _amount);
    }
    
    // Mark as paid
    function markAsPaid(uint _id) public {
        require(utangList[_id].customer == msg.sender, "Only customer can mark as paid");
        require(!utangList[_id].paid, "Already paid");
        
        utangList[_id].paid = true;
        emit UtangPaid(_id);
    }
    
    // Get all utang for a customer
    function getCustomerUtang(address _customer) public view returns (Utang[] memory) {
        uint count = 0;
        
        // Count first
        for(uint i = 0; i < utangList.length; i++) {
            if(utangList[i].customer == _customer) {
                count++;
            }
        }
        
        // Create array
        Utang[] memory result = new Utang[](count);
        uint index = 0;
        
        for(uint i = 0; i < utangList.length; i++) {
            if(utangList[i].customer == _customer) {
                result[index] = utangList[i];
                index++;
            }
        }
        
        return result;
    }
    
    // Get total unpaid
    function getTotalUnpaid(address _customer) public view returns (uint) {
        uint total = 0;
        for(uint i = 0; i < utangList.length; i++) {
            if(utangList[i].customer == _customer && !utangList[i].paid) {
                total += utangList[i].amount;
            }
        }
        return total;
    }
}

